USE graduate_db;
DROP TABLE IF EXISTS debtors_individuals;
CREATE TABLE debtors_individuals(
	id INT UNSIGNED AUTO_INCREMENT PRIMARY KEY,
	last_name VARCHAR(100) NOT NULL,
	first_name VARCHAR(100) NOT NULL,
	patronimic VARCHAR(100) NOT NULL,
	date_of_birth DATE NOT NULL,
	place_of_birth VARCHAR(100),
	phone_number VARCHAR(20),
	region_of_bancrupcy_case INT UNSIGNED NOT NULL,
	individual_tax_number VARCHAR(20) NOT NULL,
	personal_retirement_number VARCHAR(20) NOT NULL,
	previous_name VARCHAR(200),
	type_of_debtor INT UNSIGNED NOT NULL,
	place_of_living VARCHAR(200)
);

UPDATE debtors_individuals SET date_of_birth = 
	MAKEDATE(
		FLOOR(1950 + RAND() * 52),
		FLOOR(1 + RAND() * 365)
	);
UPDATE debtors_individuals SET individual_tax_number = 
	CONCAT(
		FLOOR(0 + RAND()* 10),
		FLOOR(0 + RAND()* 10),
		FLOOR(0 + RAND()* 10),
		FLOOR(0 + RAND()* 10),
		FLOOR(0 + RAND()* 10),
		FLOOR(0 + RAND()* 10),
		FLOOR(0 + RAND()* 10),
		FLOOR(0 + RAND()* 10),
		FLOOR(0 + RAND()* 10),
		FLOOR(0 + RAND()* 10),
		FLOOR(0 + RAND()* 10),
		FLOOR(0 + RAND()* 10)
	);
UPDATE debtors_individuals SET personal_retirement_number = 
	CONCAT(
		FLOOR(0 + RAND()* 10),
		FLOOR(0 + RAND()* 10),
		FLOOR(0 + RAND()* 10),
		"-",
		FLOOR(0 + RAND()* 10),
		FLOOR(0 + RAND()* 10),
		FLOOR(0 + RAND()* 10),
		"-",
		FLOOR(0 + RAND()* 10),
		FLOOR(0 + RAND()* 10),
		FLOOR(0 + RAND()* 10),
		" ",
		FLOOR(0 + RAND()* 10),
		FLOOR(0 + RAND()* 10)
	);

CREATE TABLE previous_names(
	id INT UNSIGNED,
	name VARCHAR(100)
);



UPDATE debtors_individuals SET previous_name = 
	(SELECT name FROM previous_names WHERE debtors_individuals.id = previous_names.id LIMIT 1);

DROP TABLE IF EXISTS previous_names;